void readBMP(const char* filename) {
    int i;
    FILE* f = fopen(filename, "rb");
    if(f==NULL) {
         std::cout << "no file found" << std::endl;
         return;
    }
    unsigned char info[54];
    fread(info, sizeof(unsigned char), 54, f); // read the 54-byte header
    short sig = *(short*)&info[0];
    short sigCmp = 0x4D42;//"BM" in little endian
    if(sig != sigCmp){
         std::cout << "invalid file is not a bitmap." << std::endl;
         return;
    }
    // extract image height and width from header
    int dibHeaderSize = *(int*)&info[14];
    int width = *(int*)&info[18];
    int height = *(int*)&info[22];
    short planes = *(int*)&info[26];
    short bitsPerPixel = *(int*)&info[28];
    int compression = *(int*)&info[30];
    int imageSize = *(int*)&info[34];
    int channels = bitsPerPixel/8;
    if(dibHeaderSize != 40) {
        std::cout << "readBMP is intended for dib header size of 40 bmps" << std::endl;
    }
    std::cout << "dibHeaderSize is: "<< dibHeaderSize << std::endl;
    std::cout << "width is: "<< width << std::endl;
    std::cout << "height is: "<< height << std::endl;
    //std::cout << "imageSize is: "<< imageSize << std::endl;
    //std::cout << "compression is: "<< imageSize << std::endl;
    //std::cout << "planes is: "<< planes << std::endl;
    std::cout << "bits per pixel is: "<< bitsPerPixel << std::endl;
    if(width < 0 || height < 0) {
         std::cout << "invalid size" << std::endl;
         return;
    }
    int size = channels * width * height;
    std::cout << "size is: "<< size << std::endl;
    unsigned char* data = new unsigned char[size]; 
    fread(data, sizeof(unsigned char), size, f);
    fclose(f);
    if(channels == 3) {
        for(i = 0; i < size; i += 3)
        {
            unsigned char tmp = data[i];
            data[i] = data[i+2];
            data[i+2] = tmp;
        }
    }
    setDensityFromPic(data,true,channels ==1);
    delete [] data;
}

// simulation functions
int getNumCells() {
  return numCells;
}

int getNumChannels() {
  return channels;
}

void setDensityFromPic(const unsigned char *data, bool fileRead, bool monoChrome) {
    mySimulator.reset();
    for (int i = 0,ii = mySimulator.getNumCells(); i < mySimulator.getNumCells(); ii--, i++) {
        for (int j = 0, jj = mySimulator.getNumCells(); j < mySimulator.getNumCells(); jj--, j++) {
            if(channels == 1) {
                mySimulator.setDensity(i, j, data[IXMain(ii, jj,mySimulator.getNumCells())]);
            } else {
                for (int c = 0; c < channels; c++) {
                    if(monoChrome) {
                        if(fileRead) {
                            mySimulator.setDensity(i, j, c, data[IXMain(i,j,mySimulator.getNumCells())]/15);
                        } else {
                            mySimulator.setDensity(i, j, c, data[IXMain(ii, jj,mySimulator.getNumCells())]);
                        }
                    } else {
                        if(fileRead) {
                            mySimulator.setDensity(i, j, c, data[IXMColor(j, ii, c)]/15);
                        } else {
                            mySimulator.setDensity(i, j, c, data[IXMColor(jj, ii, c)]/15);
                        }
                        /*if(i < 1) {
                            std::cout << "before: " << std::hex << (int) (data[IXMColor(i, j, c)]) <<std::endl;
                            std::cout << "after: " << std::hex << (int) mySimulator.getDensity(IXColor(i, j, c)) <<std::endl;
                        }*/

                    }
                }
            }
        }
    }
    //mySimulator.printDensity();
}

